(window.webpackJsonp=window.webpackJsonp||[]).push([[23],{480:function(e,n,a){"use strict";a.r(n);var r=a(8),t=Object(r.a)({},(function(){var e=this,n=e.$createElement,a=e._self._c||n;return a("ContentSlotsDistributor",{attrs:{"slot-key":e.$parent.slotKey}},[a("p",[a("RouterLink",{attrs:{to:"/en/2019/05/26/hackaburg-2019/"}},[e._v("English")]),e._v(" | Deutsch")],1),e._v(" "),a("h2",{attrs:{id:"was-ist-hackaburg"}},[a("a",{staticClass:"header-anchor",attrs:{href:"#was-ist-hackaburg"}},[e._v("#")]),e._v(" Was ist Hackaburg?")]),e._v(" "),a("p",[e._v("Hackaburg, der Hackathon an der TechBase in Regensburg, fand vom 24.5. bis zum 25.5 statt und ich nahm mit Freunden aus der Universität teil. Für alle von uns war das der erste Hackathon, daher reisten wir mit kleinen Erwartungen, aber großer Vorfreude am Tag vorher aus Dresden an.")]),e._v(" "),a("h2",{attrs:{id:"wie-lief-das-ab"}},[a("a",{staticClass:"header-anchor",attrs:{href:"#wie-lief-das-ab"}},[e._v("#")]),e._v(" Wie lief das ab?")]),e._v(" "),a("p",[e._v('Nach der ersten Einführung, Pitches und Mittagessen, begannen wir mittags mit dem Coden. Wir machten einige Pausen, um zu Essen, im Bällebad zu chillen oder Mario Kart zu spielen, aber arbeiteten hart durch den Rest der Nacht bis zum Code-Freeze am Samstag Mittag. Nach einigen 5 minütigen Erklärrunden mit den Judges und unserem Team, wurde unser Projekt als einer der Finalisten ausgewählt. Das Event bestand aus 5 Tracks, sprich Arten von Projekten, von denen jede von einer Firma gesponsort wurde, sodass am Ende 5 Gewinner zu wählen waren. Jedes der Finalisten-Teams hatte genau 3 Minuten für den finalen Pitch und eine Demonstration dessen, an was wir die letzten 24 Stunden gearbeitet hatten. Wir waren ein wenig nervös, da wir sehr müde waren und das unsere erste Veranstaltung dieser Art war,\naber es lief gut, und wir wurden als Gewinner für unseren Track "Digital Insurance" gewählt! Wir waren sehr glücklich über unseren finalen Prototyp und natürlich, dass wir gewannen und so fuhren wir am Sonntag Morgen nicht nur müde und erschöpft, als auch beladen mit Merchandise, mit gefüllten Mägen und dem Preis im Gepäck überglücklich nach Hause.')]),e._v(" "),a("h2",{attrs:{id:"und-was-habt-ihr-gebaut"}},[a("a",{staticClass:"header-anchor",attrs:{href:"#und-was-habt-ihr-gebaut"}},[e._v("#")]),e._v(" Und was habt ihr gebaut?")]),e._v(" "),a("p",[e._v("Unser Prototyp war ein Chatbot, gebaut mit der Conversational-AI von SAP, einem eigenem coolen Frontend und ein einem mächtigen Backend mit Spring-Boot. Die Anwendung war in der Lage eine intelligente und unterhaltsame Konversation mit dem Nutzer zu führen, ihm relevante Fragen zu stellen, um ihm schließliche eine auf ihn zugeschnittende Versicherung zu empfehlen, während alle gesammelten und fehlende Daten pro User im Backend persistiert werden.")]),e._v(" "),a("p",[e._v("Insgesamt war es eines der coolsten Wochenende, das ich je hatte, das Event selbst und die Challenges waren spaßig, die Organisatoren machten einen super Job, Verpflegung, Unterbringung, Goodies und lustige Spiele bereitzustellen. Meine Teammitglieder machten auch einen fantastischen Job undd wir hatten viel Spaß beim Coden, daher würde ich ein solches Wochenende jederzeit wiederholen!")]),e._v(" "),a("p",[a("img",{attrs:{src:"https://user-images.githubusercontent.com/33640025/86590921-d51f1000-bf90-11ea-83c6-bdc9aa69eec6.png",alt:"Hackaburg 2019"}})])])}),[],!1,null,null,null);n.default=t.exports}}]);